import React, { Component } from 'react'
import * as FaIcons from 'react-icons/fa';
import Login from '.Login./Login/Login';
import SignupForm from './Login/SignupForm';



export default App;

export const TopbarData = [
    {
        title: 'Login',
        // icon: <FaIcons.FaHome />,
        link: '/login',
        Component: Login
    },
    {
        title: 'Register',
        // icon: <FaIcons.FaUser />,
        link: '/register',
        Component: SignupForm
    }
];
